import React from "react";
import { Container } from "@material-ui/core";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function stats () {
    return <Container> 
        <Row>
            <Col><h2>Việt Nam</h2></Col>
            <Col><h2>Thế giới</h2></Col>
        </Row>
    </Container>
}

export default stats;
